// In your main component or page where you use the carousel
import React, { useState, useEffect } from 'react';
import MovieCarousel from './components/MovieCarousel';
import { fetchMoviePosters } from './api'; // Assuming you have an API function for this

const HomePage = () => {
    const [posterUrls, setPosterUrls] = useState([]);

    useEffect(() => {
        const loadPosters = async () => {
            try {
                const urls = await fetchMoviePosters(); // Fetch the URLs from your API
                setPosterUrls(urls);
            } catch (error) {
                console.error('Error fetching movie posters:', error);
            }
        };

        loadPosters();
    }, []);

    return (
        <div>
            <h1>Welcome to MovieMatch</h1>
            <MovieCarousel imageUrls={posterUrls} />
            {/* Other components */}
        </div>
    );
};

export default HomePage;
